import React from 'react'
import Navbar from '../Navbar/Navbar';
import {Outlet} from 'react-router-dom'
import './Layout.css'
const Layout = () => {
  return (
    <>
    <Navbar/>

    <div>
        <Outlet/>
    </div>
    
    </>
  )
}

export default Layout
